INSERT INTO `mac_vod` VALUES('19419','美国谍梦第一季The Americans','花园影视','meiguodiemengdiyijiTheAmericans','M','','http://www.mjt100.com/uploads/litimg/201611/59eee100496e458d.jpg','http://www.mjt100.com/uploads/litimg/201611/59eee100496e458d.jpg','','花园影视','花园影视','美国政府,美国文化,演绎法,苏联,国家','高清','','英语','0','15','','','0','0','0','0','0','0','0','0','25163','0','0','0','0','0','0','1.0','0','76','1481719391','1482342973','0','0','《美国谍梦第一季The Americans》别名()，美国谍梦第一季于2013年1月30日播出。这剧的大纲太神奇了，而且基本演绎法里有一集内容跟这剧居然一样，讲两个结成夫妻长期在美国潜伏的苏联间谍的故事，美国谍梦里丈夫在美国呆久了已经开始有点被美国文化同化，会考虑转投美国政府。妻子却是对国家死忠，宁死不叛国。虽然只是因为工作原因而被迫结合，丈夫已深爱上妻子。。间谍是最糟糕的职业，为一个组织一个国家的使命人格分裂，随时有生命危险，当一旦暴露或失去价值，还有被背叛的结局。想不通是什么支撑他们能这样坚持，唉呀，我被剧情卷进去了…但耐人寻味的是有那么多的国家，为啥专选俄国间谍作为题材？美国和俄国的关系到底是啥样的？','ykyun','','','第1集$CODg4OTY4OA==#第2集$CODg4OTY4MA==#第3集$CODg4OTY3Ng==#第4集$CODg4OTY4NA==#第5集$CODg4OTY3Mg==#第6集$CODg5MDAyMA==#第7集$CODg5MDExMg==#第8集$CODg5MDEyOA==#第9集$CODg5MDE0MA==#第10集$CODg5MDIwNA==#第11集$CODg5MDIxMg==#第12集$CODg5MDI0OA==#第13集$CODg5MDI4NA==','','','','');
