INSERT INTO `mac_vod` VALUES('19432','美国谍梦第四季The Americans','花园影视','meiguodiemengdisijiTheAmericans','M','','http://www.mjt100.com/uploads/litimg/201611/209f7d335b0a842b.jpg','http://www.mjt100.com/uploads/litimg/201611/209f7d335b0a842b.jpg','','花园影视','花园影视','克格勃间谍,俄罗斯,日常生活,普通人,老百姓','高清','','英语','0','15','','','0','0','0','0','0','0','0','0','215729','0','0','0','0','0','0','7.0','0','261','1481719393','1482342975','0','0','《美国谍梦第四季The Americans》别名()，美国谍梦第四季于2016年3月16日播出。美国谍梦这剧更贴近生活的肥皂间谍局.夫妻俩没有一个在国防局工作,哪怕沾边也行啊.两人就是平民老百姓,平民老百姓随时可见政坛人物?我倒很期待他们背叛组织,两面受敌的景象.此剧依我看当家庭肥皂剧看还是不错的......节奏不错，情节交代顺畅，音乐烘托到位，女主大靓，可以继续追。虽然美苏冷战期的基调无感，但身份认同的问题在什么时候都说得通。坐等主角被邪恶的美帝腐化啦。《美国谍梦》是根据2010年俄罗斯间谍网曝光事件改编，主创本人曾任中情局特工。不同于以往谍战剧冷色调的摄影和阴沉的音乐，而以以暖色调居多。描写了一对长期潜伏美国的克格勃间谍夫妇，本剧将间谍还原为普通人，从普通人的日常生活角度来表现间谍的努力，这或许是谍战片的新特点。','ykyun','','','第1集$CODg4OTczNg==#第2集$CODg4OTc0MA==#第3集$CODg4OTc0NA==#第4集$CODg4OTc1Mg==#第5集$CODg4OTc0OA==#第6集$CODg5MDM2MA==#第7集$CODg5MDM3Mg==#第8集$CODg5MDM5Ng==#第9集$CODg5MDQwOA==#第10集$CODg5MDQxNg==#第11集$CODg5MDYzMg==','','','','');
