INSERT INTO `mac_vod` VALUES('10050','纸房子','01:01:44','zhifangzi','Z','','/npimg.php?pic=http://pic5.qiyipic.com/image/20161201/68/ee/v_111238840_m_601_m1_180_236.jpg','/npimg.php?pic=http://pic5.qiyipic.com/image/20161201/68/ee/v_111238840_m_601_m1_180_236.jpg','','刘浩闻,吴烨','马春涛','','奇艺高清','大陆','国语','2016','9','',',78,','0','0','0','0','0','0','0','0','859538','0','0','0','0','0','0','10.0','0','19','1480605385','1482345860','0','0','陈擎从昏迷中醒来，记忆全无，被一个陌生男人许世林锁在7楼卧室。陈擎以为被绑架，向窗外女子方欣求救，最终却发现方欣和许世林是一伙的。沮丧之际，陈擎发现衣服口袋里有手机，伺机报警，却被许世林告知自己是入室抢劫的罪犯，赶紧挂电话。在陈擎恳求下，方欣趁许世林不在，心软放了陈擎，陈擎却意外看到自己手机里有和方欣的聊天记录，非但没走，反而质问方欣两人的真实关系……随着陈擎的记忆碎片般拼合，事情的真相渐渐浮出水面，一场关于伦理和家庭的杀人悲剧即将上演，而结局更加出人意料。','qiyi$$$ykyun','$$$','$$$','高清$http://www.iqiyi.com/v_19rr9f82js.html$$$BD$CODgzMTM2MA==','','','','');
INSERT INTO `mac_vod` VALUES('10051','阴阳秘闻','2016-12-2 17:32:28','yinyangmiwen','Y','','/npimg.php?pic=http://pic2.qiyipic.com/image/20161201/a4/6f/v_111232399_m_601_m1_180_236.jpg','/npimg.php?pic=http://pic2.qiyipic.com/image/20161201/a4/6f/v_111232399_m_601_m1_180_236.jpg','','游千惠,孙书博','游千惠','','BD1280超清中字','大陆','国语','2016','9','',',78,','0','0','0','0','0','0','0','0','587752','0','0','0','0','0','0','8.0','0','268','1480605385','1482367235','0','0','时尚恐怖网络小说作家南希有一天意外迎接三位好友的到来，同住在一个屋檐下恐怖血案连连发生！大麦死后，森雅直言南希的家有凶灵作恶，却得不到两人的信任，最终意外惨死，两位好友离世让南希崩溃，同时看似惺惺相惜的四人实则矛盾重重的内心也渐渐解开.而她的精神状况让志浩担忧，但是接连的怪事无法让人理解，志浩以身犯险也逃不开厄运！南希伤心绝望之际，一觉醒来，孤独的门铃再次响起，三位好友再次出现仿佛一切都没发生，南希睁大了惊恐的眼睛，门渐渐虚掩，南希的脸上浮现诡异的笑容……','qiyi$$$ykyun$$$letv$$$sohu$$$qq','$$$$$$$$$$$$','$$$$$$$$$$$$','高清$http://www.iqiyi.com/v_19rr961t2w.html$$$BD$CODgzMTg0MA==$$$高清完整版$http://www.le.com/ptv/vplay/27145998.html$$$高清$http://film.sohu.com/album/9251612.html$$$腾讯高清$http://v.qq.com/x/cover/uvjxfq4csvtuc5c/p0350t4frqr.html','','','','');
INSERT INTO `mac_vod` VALUES('14923','谁是谁的谁','2016-12-11 17:51:49','shuishishuideshui','S','','/npimg.php?pic=http://pic2.qiyipic.com/image/20161209/62/39/v_111440156_m_601_m1_180_236.jpg','/npimg.php?pic=http://pic2.qiyipic.com/image/20161209/62/39/v_111440156_m_601_m1_180_236.jpg','','郭天杰,冀雅凡','郭坚','中年男子,服务员,便利店,可乐,汽车','BD1280超清中字','大陆','国语','2016','17','',',78,','0','0','0','0','0','0','0','0','309778','0','0','0','0','0','0','6.0','0','384','1481637276','1482367274','0','0','夜晚的马路空旷而寂静，没有风，连路边的野草也停止了舞动，就在这时，一辆飞奔的汽车风驰而过，速度太快，只看见了影子和听到了声音就消失了，车窗里扔出了一个可乐瓶子，叮铃当啷砸在地上滚到镜头前停下来，夜晚又恢复了平静，风也不见了… 就在这样的夜晚，一家便利店被打劫了，懦弱无能的店老板面对起了内部矛盾的劫匪又能怎样呢？玩世不恭的当地青年贾英俊怎么也不会想到自己的泡妞计划也在这个夜晚全被改变了，没有正经职业的中年男子，整天靠着坑蒙拐骗却也被卷入其中，便利店的服务员白雪惊奇的发现整个事情没有想象的那么简单，所有人看似自然的来到便利店，但又有惊人的相似之处，好像都是被安排好的一样，劫匪、老板、店员、贾英俊、中年男子等最后会有什么样的结果呢？好像还有另外的结局…','qiyi$$$ykyun','$$$','$$$','高清$http://www.iqiyi.com/v_19rra83nj0.html$$$BD1280高清$COTE3MTU3Mg==','','','','');
INSERT INTO `mac_vod` VALUES('15475','秦始皇陵的惊天秘密','2016-11-28 23:54:45','qinshihuanglingdejingtianmimi','Q','','8de0ffe3ca91727bt.jpg','','','内详','内详','秦始皇陵,考古学家,考古发现,兵马俑,国家地理','BD高清','大陆','国语','2016','10','','','0','0','0','0','0','0','0','0','799470','0','0','0','0','0','0','6.0','0','116','1481638363','1482367153','0','0','1974年，中国中部地区的一名农民在距离秦始皇墓地不足1英里的地方发现了一个前所未有的发现：被埋藏在地下的8000余座兵马俑。自发现以来的40年中，考古学家和学者持续对这个令人惊叹的遗迹进行研究，并发掘出很多遗迹，但一直未能真正破解谜题。这次，国家地理频道和英国广播公司（BBC）联手，纪录了陵墓考古学家新的挖掘进程，不仅为秦始皇考古发现提供的新的启示，并且重写了中国与西方世界交流沟通的历史。','ykyun','','','BD$CODY2MDcyOA==','','','','');
INSERT INTO `mac_vod` VALUES('15476','我家买了动物园','2016-11-30 19:02:57','wojiamailiaodongwuyuan','W','','54ca8f81abfd7.jpg','','','马特·达蒙/斯嘉丽·约翰逊/麦琪·伊丽莎白·琼斯/科林·福特','卡梅伦·克罗','约翰逊,斯嘉丽,hellip,本杰明,动物园','BD1280超清中字','美国','英语对白 中文字幕','2011','10','','','0','0','0','0','0','0','0','0','985287','0','0','0','0','0','0','5.0','0','497','1481638364','1482367164','0','0','作家本杰明&middot;密（马特&middot;达蒙 Matt Damon 饰）生性喜爱冒险，然而半年前的丧妻之痛令他至今无法释怀，儿子迪伦和小女儿洛希同样不能适应失去母亲的生活，迪伦因偷窃和阴暗的美术创作导致被学校开除，本杰明没有听从哥哥邓肯的建议，拒绝从新的爱情中获取乐观心态，也放弃了专栏写 作，筹划和儿女换到全新的环境继续生活。而本杰明的新家居然是一座荒废的动物园！因为看到了洛希和动物的友好接触，本杰明决定接收这座还收留着众多动物的野生动物园，并带领管理人凯莉（斯嘉丽&middot;约翰逊 Scarlett Johansson 饰）率领的留守团队重新修葺动物园，希望在夏季开放之前，迎来动物园的再度营业和自己家庭的新生&hellip;','ykyun','','','BD$CODc0NTI0OA==','','','','');
INSERT INTO `mac_vod` VALUES('15477','卧虎','2016-11-28 23:57:02','wohu','W','','0e0f3cb7b5229fe7.jpg','','','曾志伟  吴镇宇  陈小春  秦海璐','王光利麦子善','曾志伟,陈小春,张智霖,秦海璐,苏菲','BD高清','大陆','国语','2016','10','','','0','0','0','0','0','0','0','0','644025','0','0','0','0','0','0','6.0','0','82','1481638364','1482367154','0','0','相传警方派驻了上千卧底深入黑帮，就等时机成熟把社团一网打尽。此时警方雄图大志，将潜伏已久终于爆发的行动命名为&ldquo;百年孤寂&rdquo;。洪兴社树大招风，社团里各个话事人开始草木皆兵。相反洪兴老大淡定自若，他的女人苏菲（秦海璐饰）替他周旋于各帮派期间，力稳局势。 然而洪兴社团的众人已经按捺不住躁动。人人自危的情势开始：分管不同领域的华超（吴镇宇饰）、黎继祥（曾志伟饰）、钟孝礼（张智霖饰）、游志标（陈小春饰）几人当中，有的已经被警方掌握了犯罪证据，有的正陷入一场恐慌，看不清身边谁人是卧底身份。警方铲除洪兴社团即日可待。','ykyun','','','BD$CODY2MTIzNg==','','','','');
INSERT INTO `mac_vod` VALUES('15478','第二扇窗','2016-11-30 19:03:30','diershanchuang','D','','583e93fd1718d.jpg','','','村上虹郎/吉永淳/杉本哲太/松田美由纪','河濑直美','hellip,处女作,大海,东京,歌声','BD1280超清中字','日本','日语对白 中文字幕','2014','10','','','0','0','0','0','0','0','0','0','876990','0','0','0','0','0','0','5.0','0','23','1481638365','1482367165','0','0','被亲测网大海所包围的奄美大岛，少年界人（村上虹郎 饰）和少女杏子（吉永淳 饰）各自经历着人生的波动时刻。月圆之夜，界人目睹了背部有纹身的男子漂在海中死前的一刻，心灵备受触动。他对母亲（渡边真起子 饰）和男人们纠缠不清的行径感到反感，于是决定去东京看望父亲（村上淳 饰）。杏子的母亲（松田美由纪 饰）是岛民们倍为敬重的女巫，但女巫也无法逃脱生死的宿命。母亲病入膏肓之际，杏子矜持的心土崩瓦解。少男少女愁绪满怀，涛声、风声、歌声、琴声，汇聚成一首关于生命的颂歌&hellip;&hellip;本片为演员村上淳和作为歌手的前妻UA之子村上虹郎的银幕处女作。','ykyun$$$youku$$$qq','$$$$$$','$$$$$$','BD$CODc0NTI2MA==$$$http://v.youku.com/v_show/id_XMTgzMzM5MzI0NA==.html$$$腾讯高清$http://v.qq.com/x/cover/beoiizlm4a1hkex/n0022gpg47a.html','','','','');
INSERT INTO `mac_vod` VALUES('15479','大地惊雷','','dadijinglei','D','','http://i2.letvimg.com/vrs/201307/05/a0efe78a6e284934b393fd0d93bffc95.jpg','[db:缩略图]','[db:幻灯图]','杰夫·布里吉斯/马特·达蒙/乔什·布洛林/海莉·斯坦菲尔德/巴里·佩珀/戴金·马修斯/贾拉斯·康罗伊/保罗·瑞/多姆纳尔·格利森//布鲁斯·格林//','乔尔·科恩/伊桑·科恩/','[db:tag]','乐视高清','美国','','0','16','',',345,','0','0','0','0','0','0','0','0','687917','0','0','0','0','0','0','1.0','0','300','1481638365','1482349180','0','0','因父亲被害，14岁的玛蒂·罗斯（海莉·斯坦菲尔德 Hailee Steinfeld 饰）抵达案发地史密斯堡，作为长女代表家人处理后事。杀死父亲的凶手汤姆·切尼已不知去向，在这枯燥又忙碌的西部小镇上，没人关心杀死异乡人的逃犯何时落网。玛蒂决定自己雇佣警察为父亲报仇，经人介绍，她选择与醉醺醺的警长罗斯特·考波恩（杰夫·布里吉斯 Jeff Bridges 饰）合作，同时，一名来自德克萨斯的骑警拉博夫（马特·达蒙 Matt Damon 饰）亦希望抓获汤姆·切尼，好在德州获得高额悬赏，为了让切尼在本地被正法，玛蒂必须在拉博夫之前抓到杀父仇人。成熟而坚强的玛蒂与罗斯特踏入了保留地，在那里有众多不法之徒，以及暂时逍遥法外的仇人……','letv','','','高清完整版$http://www.le.com/ptv/vplay/1607365.html','','','','');
INSERT INTO `mac_vod` VALUES('15480','无敌小飞猪','','wudixiaofeizhu','W','','http://i0.letvimg.com/lc06_isvrs/201611/07/15/18/c7db9b94-1692-4590-bead-ab300fd558e9.jpg','[db:缩略图]','[db:幻灯图]','张立威/徐少强/','宋占涛/','[db:tag]','乐视高清','中国大陆','','0','16','',',345,','0','0','0','0','0','0','0','0','69165','0','0','0','0','0','0','8.0','0','428','1481638366','1482349185','0','0','主人公凌菲是一个略带“公主病”的小千金，被父母送到了一个古怪的训练营里打发暑假。在这个古怪的训练营里凌菲认识了电脑神童艾丁，俩人很快成为了好朋友； 　　某天夜里，凌菲独自一人出来散步，偶遇了从天而降的小飞猪。凌菲觉得它很可爱就把它带回了宿舍。从此，凌菲带着小飞猪一起参加训练营的各种活动。 　　一天小飞猪闯进了教授古拉法的实验室里，跟教授捣乱，觉得教授的实验室里非常好玩，准备下次带凌菲他们一起来玩。于此同时，由外星势力老大派来的两只外星虫子偷偷潜入了训练营，准备偷取藏在教授实验室里的时空法器。小飞猪带着凌菲等人来到教授古拉法的实验室，却发现教授受了伤，并指知道了教授的真实身份。原来古拉法是活了上千年的魔法老师，一直掌握着守护开启魔法时空门的使命！ 　　教授的无私感染了小孩子们，于是，凌菲等人决定帮助教授抢回装有时空法器的保险箱。最终，在法力无边的小飞猪的帮助下，外星生物的计划彻底落空了。教授并没有采用暴力手段对付两只外星虫子，而是决定开启时空之门，送外星虫回去；经过了此番波澜，训练营里的所有人都开始“长大”，所有人都得到了新的启迪与感悟。 　　同时，小飞猪也完成了此次猪猪星球派给他的“天使任务”。小飞猪望着大家恋恋不舍，最后化成一道光穿梭天空……','letv','','','高清完整版$http://www.le.com/ptv/vplay/22533421.html','','','','');
INSERT INTO `mac_vod` VALUES('15481','沉默37人','2016-11-29 0:53:05','chenmo37ren','C','','8fb50536c9074334.jpg','','','Christina Brucato / Mario Ramos / Samira Wiley','PukGrasten','station,stories,unusual,people,events','BD高清','欧美','英语','2016','10','','','0','0','0','0','0','0','0','0','495178','0','0','0','0','0','0','2.0','0','308','1481638367','1482367154','0','0','At feature length, Puk Grasten&rsquo;s 37 reconstructs events that took place on March 12 and 13, 1964, in the Kew Gardens neighborhood near Austin Street and the station for the Long Island Railroad. But while the murder of Kitty Genovese might be the most unusual of those events, 37 focuses on the stories and people that surround and bear witness to that horrific act. We see what t..','ykyun','','','BD$CODY2MzMyMA==','','','','');
INSERT INTO `mac_vod` VALUES('15482','愈合','2016-11-30 19:05:35','yuhe','Y','','583e9d1c53773.jpg','','','雨果·维文/泽维尔·塞缪尔/罗伯特·泰勒','Craig.Monahan','猫头鹰,马特,男人,农场,修复','BD1280超清中字','澳大利亚','英语对白 中文字幕','2014','10','','','0','0','0','0','0','0','0','0','945977','0','0','0','0','0','0','6.0','0','306','1481638367','1482367157','0','0','尤Kahdem是一个男人谁几乎已经放弃了生命，判处低设防监狱农场，完全不具威胁性的环境，但仍然觉得有些人是可以改造的。在韩元WRON，办案员马特&middot;佩里已经建立了一个独特的方案，通过让他们受伤的猛禽康复有责任修复破碎的男人 - 美丽的，可怕的骄傲鹰，隼和猫头鹰。排除万难，马特发生在尤他的头号测试案例，介绍他到Yasmine的，雄伟的楔尾鹰与一个2米的臂展。如果这两个可以驯服对方，一切皆有可能。','ykyun$$$youku','$$$','$$$','BD$CODc0NTgyMA==$$$http://v.youku.com/v_show/id_XMTgzMjA1NjcxMg==.html','','','','');
INSERT INTO `mac_vod` VALUES('10274','西涯侠','','xiyaxia','X','','http://r1.ykimg.com/05160000583E89C467BC3C767403864C','','','白客,至尊玉','','','更新至10集','大陆','国语','2016','12','','','0','0','0','0','5','0','0','0','663646','0','0','0','0','0','0','4.0','0','448','1480696781','1482351355','0','0','','youku','','','http://v.youku.com/v_show/id_XMTg1NjU1NTY0MA==.html#http://v.youku.com/v_show/id_XMTg1NjY2NDE5Ng==.html#http://v.youku.com/v_show/id_XMTg1NjY5Mjk0NA==.html#http://v.youku.com/v_show/id_XMTg1NjcxOTI2OA==.html#http://v.youku.com/v_show/id_XMTg1Njc0MDEzMg==.html#http://v.youku.com/v_show/id_XMTg1NzMxMjU3Ng==.html#http://v.youku.com/v_show/id_XMTg2Nzc4MDE3Ng==.html#http://v.youku.com/v_show/id_XMTg2Nzc5NzYxMg==.html#http://v.youku.com/v_show/id_XMTg2Nzg3Mzg4MA==.html#http://v.youku.com/v_show/id_XMTg2Nzg4OTc2MA==.html#http://v.youku.com/v_show/id_XMTg3MTEzOTE2MA==.html','','','','');
INSERT INTO `mac_vod` VALUES('17147','生死相随','共21集全','shengsixiangsui','S','','http://photocdn.sohu.com/kis/fengmian/1054/1054767/1054767_ver_big.jpg','http://photocdn.sohu.com/kis/fengmian/1054/1054767/1054767_ver_big.jpg','','徐洪浩/余雨韩/侯长荣/马魁/杨皓宇','谢家良','才华横溢,工农红军,生死相随,地下党,独立师','共21集全','大陆','国语','2005','12','',',570,','0','0','0','0','0','0','0','0','960606','0','0','0','0','0','0','6.0','0','125','1481692193','1481692193','0','0','阴险狡诈、豪爽睿智，掀起闽东苏区革命风暴。二十年代湘、赣、闽一代土匪、军阀横行，黑恶势力不断壮大，帮派搏杀昏天暗地，争权夺挚。以青龙帮为首的黑暗挚力，鱼肉乡里，搅得湘闽一带民不聊生，后洋一派为了穷苦大众与之针锋相对，殊死相争。性格刚烈的山区好汉詹儒柏在一个偶然的机会，认识了才华横溢的地下党县委书记马力峰，并从此结下始终不渝的友谊。在马力峰的引导下，詹儒柏走上革命道路，并受党的重托，筹建革命武装。在敌重兵压境的严峻局势下，詹儒柏坚韧不拔，临危受命，代理闽东特委书记。他们共同领导创建了闽东工农红军独立师，开展了反“围剿”斗争。','sohu','','','生死相随第1集$http://tv.sohu.com/20151013/n423112721.shtml#生死相随第2集$http://tv.sohu.com/20151013/n423112743.shtml#生死相随第3集$http://tv.sohu.com/20151013/n423112764.shtml#生死相随第4集$http://tv.sohu.com/20151013/n423112772.shtml#生死相随第5集$http://tv.sohu.com/20151013/n423112777.shtml#生死相随第6集$http://tv.sohu.com/20151013/n423112782.shtml#生死相随第7集$http://tv.sohu.com/20151013/n423112787.shtml#生死相随第8集$http://tv.sohu.com/20151013/n423112794.shtml#生死相随第9集$http://tv.sohu.com/20151013/n423112818.shtml#生死相随第10集$http://tv.sohu.com/20151013/n423112827.shtml#生死相随第11集$http://tv.sohu.com/20151013/n423112835.shtml#生死相随第12集$http://tv.sohu.com/20151013/n423112843.shtml#生死相随第13集$http://tv.sohu.com/20151013/n423112850.shtml#生死相随第14集$http://tv.sohu.com/20151013/n423112855.shtml#生死相随第15集$http://tv.sohu.com/20151013/n423112861.shtml#生死相随第16集$http://tv.sohu.com/20151013/n423112867.shtml#生死相随第17集$http://tv.sohu.com/20151013/n423112871.shtml#生死相随第18集$http://tv.sohu.com/20151013/n423112895.shtml#生死相随第19集$http://tv.sohu.com/20151013/n423112913.shtml#生死相随第20集$http://tv.sohu.com/20151013/n423112918.shtml#生死相随第21集$http://tv.sohu.com/20151013/n423112921.shtml','','','','');
